// react
import React from 'react';

// third-party
import { NavLink } from 'react-router-dom';
import { IconAlertSvg, IconInformationSvg } from '../../content/images/svg';

function NavIcons() {
    return (
        <div className="nav-icons">
            <div>
                <a>
                    <span>
                        <IconAlertSvg className="departments__button-icon" />
                    </span>
                </a>
            </div>
            <div>
                <a>
                    <span>
                        <IconInformationSvg className="departments__button-icon" />
                    </span>
                </a>
            </div>
        </div>
    );
}

export default NavIcons;
